import React from 'react';
import {Link} from 'react-router-dom';
import "../styles/Home.css";
import {killTyped} from './HeaderComponent';

function Home(){

    return (<React.Fragment>
        <p class="h1-mini">Hey kids! It's</p>
        <h1 class='brand'>ReverendCrush<span class="h1-mini">.com</span>!</h1>
        <div class='home-links'>
        <Link onClick={ killTyped } to='/contact'>SO<span class="flicker">CIA</span><span class="fast-flicker">LS</span></Link><br />
        <Link onClick={ killTyped }to='/projects'>FO<span class="fast-flicker">R </span><span class="flicker">F<span class="about_U flicker">u</span></span>N</Link><br />
        <Link onClick={ killTyped } to='/about' >B<span class="fast-flicker">I</span><span class="flicker">O</span></Link><br />
        
        
        </div>
    </React.Fragment>);   
}

export default Home;
